  "size" REAL,
  "units" TEXT,
  "price" TEXT,
  "82" REAL,
  "82_" TEXT,
  "83" REAL,
  "83_" TEXT,
  "84" REAL,
  "84_" TEXT,
  "85" REAL,
  "85_" TEXT,
  "86" REAL,
  "86_" TEXT,
  "min_level" REAL,
  "restock_quantity" REAL,
  "restock_price" REAL,
  "supplier" REAL,
  "barcodeqr2data" TEXT,
  "barcodeqr2type" TEXT,
  "value" TEXT,
  "tags" REAL,
  "notes" TEXT,
  "stock_july" REAL,
  "thu_724" REAL,
  "fri_725" REAL,
  "sat_726" REAL,
  "sun_727" REAL,
  "mon_728" REAL,
  "tue_729" REAL,
