-- Table: money_denominations
CREATE TABLE "money_denominations" (
"coins" TEXT,
  "bills" TEXT
);


-- Table: employee_salaries_2025
CREATE TABLE "employee_salaries_2025" (
"date" TEXT,
  "amount" TEXT,
  "name" TEXT,
  "notes" TEXT,
  "payment_type" TEXT
);


-- Table: stakeholder_withdrawals_2025
CREATE TABLE "stakeholder_withdrawals_2025" (
"date" TEXT,
